import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";

const AppRoutes = () => {
  return (
    <BrowserRouter>
      <Route path="/">
        <Home />
      </Route>
    </BrowserRouter>
  );
};

export default AppRoutes;
